const socialLinks = [
  { name: "GitHub", url: "https://github.com/yourname" },
  { name: "LinkedIn", url: "https://linkedin.com/in/yourname" },
  { name: "Twitter", url: "https://twitter.com/yourname" },
  { name: "Instagram", url: "https://instagram.com/yourname" }
];

const Footer = () => {
  return (
    <footer className="border-t border-light-border dark:border-dark-border bg-light-bg dark:bg-dark-bg py-12">
      <div className="mx-auto max-w-6xl px-6">
        <div className="flex flex-col items-center justify-between gap-6 md:flex-row">
          <div className="text-center md:text-left">
            <p className="text-sm text-gray-600 dark:text-gray-400">
              © 2026 Rasika Prabath. All rights reserved.
            </p>
            <div className="mt-2 flex flex-wrap justify-center gap-4 md:justify-start">
              <a href="#" className="text-sm text-gray-500 dark:text-gray-500 hover:text-primary">
                Terms of Service
              </a>
              <span className="text-gray-400 dark:text-gray-600">•</span>
              <a href="#" className="text-sm text-gray-500 dark:text-gray-500 hover:text-primary">
                Privacy Policy
              </a>
            </div>
          </div>
          <div className="flex gap-4">
            {socialLinks.map(social => (
              <a
                key={social.name}
                href={social.url}
                target="_blank"
                rel="noopener noreferrer"
                className="flex h-10 w-10 items-center justify-center rounded-full bg-gray-200 dark:bg-dark-card text-gray-600 dark:text-gray-400 transition-all hover:bg-primary hover:text-white"
                aria-label={social.name}
              >
                <svg className="h-5 w-5" fill="currentColor" viewBox="0 0 24 24">
                  <path d="M12 2C6.477 2 2 6.477 2 12c0 4.419 2.865 8.166 6.839 9.489.5.092.682-.217.682-.482 0-.237-.009-.866-.013-1.699-2.782.604-3.369-1.342-3.369-1.342-.455-1.157-1.111-1.466-1.111-1.466-.908-.62.069-.608.069-.608 1.004.07 1.532 1.031 1.532 1.031.892 1.529 2.341 1.087 2.91.832.091-.646.349-1.087.636-1.338-2.22-.253-4.555-1.11-4.555-4.944 0-1.092.39-1.987 1.029-2.687-.103-.253-.446-1.27.098-2.646 0 0 .84-.269 2.75 1.025A9.56 9.56 0 0112 6.844a9.56 9.56 0 012.504.337c1.909-1.294 2.748-1.025 2.748-1.025.545 1.376.202 2.393.1 2.646.64.7 1.028 1.595 1.028 2.687 0 3.842-2.338 4.687-4.566 4.935.359.309.679.919.679 1.852 0 1.336-.012 2.415-.012 2.743 0 .268.18.58.688.481C19.138 20.162 22 16.417 22 12c0-5.523-4.477-10-10-10z" />
                </svg>
              </a>
            ))}
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
